real_t acado_solve_dim80_system( real_t* const A, real_t* const b, int* const rk_perm )
{
real_t det;

int i;
int j;
int k;

int indexMax;

int intSwap;

real_t valueMax;

real_t temp;

for (i = 0; i < 80; ++i)
{
rk_perm[i] = i;
}
det = 1.0000000000000000e+00;
for( i=0; i < (79); i++ ) {
	indexMax = i;
	valueMax = fabs(A[i*80+i]);
	for( j=(i+1); j < 80; j++ ) {
		temp = fabs(A[j*80+i]);
		if( temp > valueMax ) {
			indexMax = j;
			valueMax = temp;
		}
	}
	if( indexMax > i ) {
for (k = 0; k < 80; ++k)
{
	acadoWorkspace.rk_dim80_swap = A[i*80+k];
	A[i*80+k] = A[indexMax*80+k];
	A[indexMax*80+k] = acadoWorkspace.rk_dim80_swap;
}
	acadoWorkspace.rk_dim80_swap = b[i];
	b[i] = b[indexMax];
	b[indexMax] = acadoWorkspace.rk_dim80_swap;
	intSwap = rk_perm[i];
	rk_perm[i] = rk_perm[indexMax];
	rk_perm[indexMax] = intSwap;
	}
	det *= A[i*80+i];
	for( j=i+1; j < 80; j++ ) {
		A[j*80+i] = -A[j*80+i]/A[i*80+i];
		for( k=i+1; k < 80; k++ ) {
			A[j*80+k] += A[j*80+i] * A[i*80+k];
		}
		b[j] += A[j*80+i] * b[i];
	}
}
det *= A[6399];
det = fabs(det);
acado_solve_dim80_triangular( A, b );
return det;
}

